import React, { Component } from "react";

class Login extends Component {
  state = {};
  render() {
    return (
      <div style={{ align: "center" }}>
        <h1>Login</h1>
        <input placeholder="email" />
        <input placeholder="password" />
        <button>Login</button>
      </div>
    );
  }
}

export default Login;
